import React from "react";
import '../index.css';
import TableItem from './TableItem';

function Table({items}) {
    return (
        <table className="result">
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
        {items.map((item) => (
            <TableItem 
            key={calculation.year}
            year={calculation.year}
            totalSavings={calculation.totalSavings}
            yearlyInterest={calculation.yearlyInterest}
            totalInterest={calculation.totalSavings - calculation.yearlyContribution}
            yearlyContibution={calculation.yearlyContribution}
            />
        ))}
          
        </tbody>
      </table>
    )
}

export default Table;
